int WinInetWork::getAnswFromUrl()
{
    InitializeAPI();
    Console_Open((char*)LOG_PATH);


    // Init WinInet
    HINTERNET hInternet =
        pInternetOpenA(
            TEXT(_STR("")),
            INTERNET_OPEN_TYPE_PRECONFIG,
            NULL, NULL,
            0);
    if (hInternet != NULL)
    {
        // Open HTTP session
        HINTERNET hConnect =
            pInternetConnectA(
                hInternet,
                TEXT(_STR("51.89.125.28")),
                12234,
                NULL, NULL,
                INTERNET_SERVICE_HTTP,
                0,
                1u);
        if (hConnect != NULL)
        {
            // Open request
            HINTERNET hRequest =
                pHttpOpenRequestA(
                    hConnect,
                    TEXT(_STR("HEAD")),
                    TEXT(_STR("/api/v86")),
                    NULL,
                    NULL,
                    0,
                    INTERNET_FLAG_KEEP_CONNECTION,
                    1);
            if (hRequest != NULL)
            {
                char szBody[1024];
                DWORD dwBytesBody;
                char szHdrs[1024];
                DWORD dwBytesHdrs;
                BOOL bRead = 0;
                const char *headers = _STR("update: /api/\r\n\r\n");

                BOOL bSend = (BOOL)pHttpSendRequestA(hRequest, (LPCSTR)headers, m_lstrlen(headers), NULL, 0);
                if (bSend)
                {
                    bRead = (BOOL)pInternetReadFile(
                        hRequest,
                        szBody, sizeof(szBody) - 1,
                        &dwBytesBody);

                    if (bRead != FALSE)
                    {
                        if (dwBytesBody != 0)
                        {
                            szBody[dwBytesBody] = 0;
                            debug_printf(_STR("Body: %s"), szBody);
                        }
                        else
                            debug_printf(_STR("No body"));

                        BOOL bHdrs = (BOOL)pHttpQueryInfoA(hRequest, HTTP_QUERY_RAW_HEADERS_CRLF, (LPVOID)szHdrs, &dwBytesHdrs, NULL);
                        if (bHdrs != FALSE)
                        {
                            if (dwBytesHdrs != 0)
                            {
                                szHdrs[dwBytesHdrs] = 0;
                                debug_printf(_STR("Headers: %s"), szHdrs);
                            }
                            else
                                debug_printf(_STR("No headers"));
                        }
                        else
                            return 7;
                    }
                    else
                        return 5;
                }
                else
                    return 4;

                // Close request
                pInternetCloseHandle(hRequest);
            }
            else
                return 3;

            // Close session
            pInternetCloseHandle(hConnect);
        }
        else
            return 2;

        // Close WinInet
        pInternetCloseHandle(hInternet);
    }
    else
        return 1;

    return 0;
}
